import React from "react";
import { Grid } from "@material-ui/core";

const About = () => {
    return(
        <React.Fragment>

           <Grid item xs = {12} container>

               <Grid item lg = {6} md = {6} sm = {12} xm = {12} className = "about-me-grid">
                   <h1>About Me</h1>


               </Grid>
               <Grid item lg = {6} md = {6} sm = {12} xm = {12} className = "about-me-grid">

               </Grid>
           </Grid>

        </React.Fragment>
    );
}

export default About;
